import ExpenceFilter from './ExpenceFilter';



function Expence(props) {
    const Expences = useSelector( state => state.expences)
    debugger
    const filteredExpense = Expences.expences.filter((expense) => new Date(expense.date).toLocaleString('default', { year: 'numeric' }) === Expences.filterYear);
    const list = filteredExpense.map((expence) => <ExpenceItem record={expence} key={expence.id} />);

    return <Card className="expenses">
        <ExpenceFilter/>
        {list}
    </Card>
}

